import React from "react";
import style from './Task.module.css';

const Task = (props) => {
    return (
        <div className={style.task}>
            <div className={style.leftSide}>
                <div className={style.check}>
                    <input type={style.checkbox} />
                </div>
                <div className={style.taskTexst}>Do something</div>
            </div>
            <div className={style.rightSide}>
                <div className='taskDate'> 10.04.2020</div>
                <div className={style.deleteTask}>
                    <img className="delete-button {style.border-img}"
                        src="./image/trash.jpg" alt="done" width="40px" height="40px" />
                </div>
            </div>
        </div>
    )
}

export default Task;
